import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CustomerList from './components/CustomerList';
import CarList from './components/CarList';
import CustomerForm from './components/CustomerForm';
import './App.css';


const globalCustomerAddActive = false;


function handleClick1 () {
  const customerAddActive = this.globalCustomerAddActive;
  if (!customerAddActive){
    customerAddActive=true;
  } else {
    customerAddActive=false;
  }
}


function App() {

  return (
//   /*Wenn auf den Button aus Main-Buttons geklickt wird, soll die entsprechendede React Component gerendert werden! props setzen */
//    clickOnBUtton handle Event UseState auf true setzen

    <Router className="App">
      <Routes>
        <Route path="/customers" element={<CustomerList />} />
        <Route path="/cars" element={<CarList />} />
      </Routes>

      <div className="App-header">

        <h1>Autoverleih App </h1>

        <div className='Main-Buttons'>

          <button onClick={this.handleClick1}> Neukunden hinzuf√ºgen</button>
          <button onClick={null}> Kunden verwalten </button>
          <button onClick={null}> Vermietungsstatus </button>
          <button onClick={null}> Autos verwalten </button>
        </div>

        <div className='Container'>
           <CustomerForm customerAddActive={customerAddActive}/>       
        </div>

      </div>
    </Router>


  );
}

export default App;
